import { CurrencyDollarIcon } from '@heroicons/react/outline';

export const Homepage = () => (
  <>
    <div className="overflow-hidden">
      <div className="float-left text-gray-700 py-12 md:pr-8 md:w-1/2">
        <h1 className="text-2xl font-bold mb-4">EQ - Beta Launch</h1>
        <CurrencyDollarIcon className="text-blue-700 w-10 m-auto mb-2" />
        COUNT DOWN
        </div>
    </div>
  </>
);
